import './categories.styles.scss';
const App = () => {

  const List = [
    {
      id :1,
      title: 'Hats',
    },
    {
      id :2,
      title: 'Jacket',
    },
    {
      id :3,
      title: 'Sneaker',
    },
    {
      id :4,
      title: 'Womens',
    },
    {
      id :5,
      title: 'Mens',
    }
  ];

  return (
    <div className='categories-container'>
      {List.map(({title}) => (
      <div className='category-container'>
        <div className='background-image' />
        <div className='category-body-container'>
          <h2>{title}</h2>
          <p>Shop Now</p>
        </div>
      </div>    
      ))}
    </div>    
  );
};

export default App;
